import React from 'react';
import { AppBar, Toolbar, Button, makeStyles } from '@material-ui/core';
import LogoutSwitch from './LogoutSwitch';

const useStyles = makeStyles({
	tool: {
		display: 'flex',
		alignItem: 'center',
		justifyContent: 'space-between',
	},
});

export default function Navbar({ loggedIn, setLoggedIn, setDialogOpen }) {
	const classes = useStyles();
	return (
		<React.Fragment>
			<AppBar>
				<Toolbar className={classes.tool}>
					<LogoutSwitch loggedIn={loggedIn} setLoggedIn={setLoggedIn} />
					<Button onClick={() => setDialogOpen(true)}>Add Friend!</Button>
				</Toolbar>
			</AppBar>
			<Toolbar />
		</React.Fragment>
	);
}
